import './App.css';
import Navbar from './components/Navbar'
import {useState, useEffect} from 'react'
import ListWorker from './components/ListWorker'

function App() {
  let [worker, setWorker]=useState([]);

  useEffect(() => {
    getWorkers()
  }, [])

  let getWorkers = async () => {
    let response = await fetch("http://127.0.0.1:8000/api/worker/4/")
    let data = await response.json()
    console.log("data: ", data)
    setWorker(data)
} 



  return (
    <div className="container">
      <Navbar />
      <div>
        <ListWorker worker={worker} />
      </div>
    </div>
  );
}

export default App;
